const Eris = require("eris");
const Constants = Eris.Constants;

const { Schedule, SearchQuery } = require('../db/models');

const MAX_SCHEDULES_IN_GUILD = Number(process.env.MAX_SCHEDULES_PER_GUILD);
const OWNER_IDS = process.env.OWNER_IDS?.split(',');
const AVATUR_B64 = "data:image/png;base64,";

const name = "create";
const command = {
  name,
  description: "Create a search query in this channel to populate every hour",
  options: [
    {
      name: "query",
      description: "Query to search for (generally in Japanese)",
      type: Constants.ApplicationCommandOptionTypes.STRING,
      min_length: 3,
      required: true,
    },
    {
      name: "site",
      description: "Site for the query to search on",
      type: Constants.ApplicationCommandOptionTypes.STRING,
      required: true,
      choices: [
        {
          name: "Yahoo Auction Japan!",
          value: "YAJ",
        },
        {
          name: "Mercari JP",
          value: "MERCARI",
        },
        {
          name: "LashingBang",
          value: "LASHINBANG",
        },
        {
          name: "Rakuten",
          value: "RAKUTEN",
        },
        {
          name: "Mandarake",
          value: "MANDARAKE",
        },
        {
          name: "Suruga-ya JP",
          value: "SURUGAYA",
        },
      ]
    },
    {
      name: "desc",
      description: "Description for the query (generally in English)",
      type: Constants.ApplicationCommandOptionTypes.STRING,
      required: true,
    },
  ],
  dm_permission: false,
  type: Constants.ApplicationCommandTypes.CHAT_INPUT, //Not required for Chat input type, but recommended
  default_member_permissions: Constants.Permissions.manageWebhooks,
}

/**
 * @param {Eris.Client} bot
 * @param {Eris.CommandInteraction} interaction
 */
const action = async (bot, interaction) => {

  const guildId = interaction.guildID;
  const channelId = interaction.channel.id;

  const channel = bot.getChannel(channelId);


  const canManageWebhooks = interaction.appPermissions.has('manageWebhooks');

  if(!canManageWebhooks) {
    return interaction.createMessage("It seems like I don't have permissions to manage webhooks. Check if I have that, and then try running it again.")
  }


  const query = interaction.data.options.find(opt => opt.name === 'query').value.trim();
  const site = interaction.data.options.find(opt => opt.name === 'site').value;
  const desc = interaction.data.options.find(opt => opt.name === 'desc').value.trim();

  const scheduleCountInServer = await Schedule.count({
    where: {
      guildId,
    }
  });

  const isOwner = OWNER_IDS.includes(interaction.member.id);
  if (scheduleCountInServer >= MAX_SCHEDULES_IN_GUILD && !isOwner) {
    return interaction.createMessage("Max queries created, please delete existing ones");
  }

  const [queryEntry, _created] = await SearchQuery.findOrCreate({
    where: {
      query,
      site,
    },
    defaults: {
      query,
      site,
      desc,
    }
  })

  const existingSchedule = await Schedule.findOne({
    where: {
      guildId,
      channelId,
      enabled: true,
    }
  });

  let webhookURL;

  if (existingSchedule) {
    webhookURL = existingSchedule.webhookURL;
  } else {
    const webhook = await bot.createChannelWebhook(channelId, {
      name: "Moody Blues",
      avatar: AVATUR_B64,
    }, `Moody Blues | "${query}" (${desc}) @ ${site}`);

    webhookURL = `https://discord.com/api/webhooks/${webhook.id}/${webhook.token}`
    console.log(`Creating webhook: ${webhook.id}`)
  }

  await Schedule.create({
    searchQueryId: queryEntry.id,
    webhookURL,
    channelId,
    guildId,
  })

  const messages = [
    "Query Created! Please wait up to an hour to see results!"
  ];

  if(!channel.nsfw) {
    messages.push("Sometimes NSFW results get mixed in, depending on the site. Consider enabling Age Restricted mode on this channel");
  }
  return interaction.createMessage(messages.join('\n'));

}

module.exports = {
  name,
  command,
  action
}